import React, { useEffect, useState } from 'react'
import axios from 'axios'
import {useNavigate} from 'react-router-dom'
import '../css/style.css'
function Mypost(){
    const navigate=useNavigate()
    const [post,setpost]=useState([])
    useEffect(()=>{
        const onHandle=async()=>{
            try {
                const response=await axios.get('/api/v1/post/')
                setpost(response.data.data)

            } catch (error) {
                console.log(error);

            }
        }
        onHandle()
    },[])
    return (
        <>
        <div className='tt'>
            { post &&Array.isArray(post) &&post.length>0?(
                post.map((i)=>(
                    <div key={i._id}>
                         <h1>Title: {i.title}</h1>
        <h3>Excerpt:{i.excerpt}</h3>
        <h3>By Author:{i.author.Name} on {new Date(i.date).toLocaleDateString()}</h3>
        <h3>Content:{i.content}</h3>
                    </div>
                ))
       )
    :(<h1>No Post Available</h1>)}
        </div>
      <br />      <br />
<button className='g' onClick={()=>navigate('/api/v1/users/home')}>Home</button>
        </>
    )

}
export {Mypost}
